Pacwyn 23 is back with a lot of new features.



Open a lot of packs every day and complete collections of football players. The game offers you exclusive challenges, like drafts, squad building, objectives, and achievements - there is everything for you in the game. 



Pacwyn 23 is an online game, where you play with opponents from over the world or you can have fun with your friends. 



Playing Pacwyn Football Draft and Pack Opener you can:
1. Complete different collections of your favorite football players;
2. Join an association/clan with your friends, participate in association tournaments and win big rewards;
3. Open regular packs, and lightning rounds. We make a lot of fantastic pack opening events;
4. Build drafts to try different tactics in the matches;
5. Complete Objectives and receive unique achievements;
6. Play Weekend Tournaments to move to the TOP 1 in the WorldWide Leaderboard;
7. Build squads and play online matches against the opponents;
8. Use scouts to buy necessary cards for in-app currency.
9. Trade with other users for more stuff or trade with your friends;
10. Complete Pacwyn Pass and receive a lot of super rewards.
11. Use a booster to upgrade the functionality of your app.
12. Play mini-games to get even more rewards.



And especially for World Cup we provide a new in-game mode where you can win a trophy using any national team you decide.



Pacwyn 23 has a great community of users, join us right now and find new friends!



This application’s sole purpose is to help its users learn how to build the best drafts and squads, find out more about football players and updates. This application is not endorsed by or affiliated with Electronic Arts Inc or other incorporations. All trademarks and copyrights belong to their respective owners.
